        };
    }

    async componentDidMount() {
        const response = await fetch(`http://167.172.142.165/users`, {
            method: 'GET',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
                'Authorization': 'Token 19c3e6789349d414ac66ae3c17a80c4e8a12debc'
            },
        })
        const data = await response.json();
        console.log(data[0].id);
    }
    render() {
        return (
            <>
